import styled from "styled-components";

export const PotraitContainer=styled.div`
    width: 100vw;
    min-height: 100vh;
    
    background:#150f0f;
    color: #fff;
`

export const PotraitWrapper=styled.div`
    position: static;
    display: grid;
    height: auto;
    width: 100%;
    min-height: 920px;
    grid-template-rows: 1fr;
    grid-template-columns: 100%
`
export const PotraitCard=styled.div`
    margin: 0;
    padding: 0;
    border: 0;
    outline: 0;
    vertical-align: baseline;
    background: transparent;
    
`
export const PotraitImg=styled.img`
    height: 456px;
    width: 350px;
    
`

export const PotraitHeading=styled.h1`
    font-size: clamp(2rem,2.5vw,3rem);
    text-align:center;
    margin-bottom: 5rem;
`
